sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = JSON.parse(inputs.response_body);
  if(inputs.status_code == "200") {
  	outputs.status = "Success";
    outputs.name = responseBody.name;
    outputs.project_id = responseBody.projectId;
    outputs.unique_id = responseBody.uniqueId;
    outputs.email = responseBody.email;
    outputs.display_name = responseBody.displayName;
    outputs.etag = responseBody.etag;
    outputs.oauth2_client_id = responseBody.oauth2ClientId;
  } else {
  	outputs.status = "Error";
    outputs.error_message = new GoogleIdentityAccessErrorHandler().handleError(responseBody.error); 
  }
 })(inputs, outputs);

